import { Login } from "./login";
import { Link } from "react-router-dom";
import axios from "axios";
import "./App.css";

export const App:React.FC= () => {
  return (
      <BrowserRouter>
    <Routes>
      <Route path="/" element={<Home />} />
    </Routes>
  </BrowserRouter>
  );
};

export default App;
